import{_ as p}from"./_plugin-vue_export-helper.cdc0426e.js";import{o as t,c as i,f as c}from"./app.ce1b0c10.js";const l={},_=c('<ol><li><p>浏览器解析 URL  生成 HTTP 请求报文 （解析出服务器名，端口号，文件路径等信息）</p></li><li><p>DNS 解析域名：将 URL 中的域名，解析为 IP 地址。</p></li><li><p>ARP 解析 ：  将 IP 地址映射为 MAC 地址</p></li><li><p>TCP 三次握手（传输层）</p><div class="custom-container tip"><p class="custom-container-title">提示</p><p>​ 所谓的“三次握手”：为了对每次发送的数据量进行跟踪与协商，确保数据段的发送和接收同步，根据所接收到的数据量而确认数据发送、接收完毕后何时撤消联系，并建立虚连接。</p><p>为了提供可靠的传送，TCP 在发送新的数据之前，以特定的顺序将数据包的序号，并需要这些包传送给目标机之后的确认消息。TCP 总是用来发送大批量的数据。当应用程序在收到数据后要做出确认时也要用到 TCP。</p></div></li><li><p>浏览器向服务器发起 http 请求 6. 服务器响应请求 7. 页面渲染 ： 具体见下文</p></li></ol><p>ps : 附上整理的流程图，如有不当欢迎指正!</p><p><img src="https://img-blog.csdnimg.cn/5ef487ddec9841b99019d35536b4955c.png" alt="浏览器输入 URL 后的几个阶段" loading="lazy"></p><p>ps ：TCP 三次握手流程图</p><p><img src="https://img-blog.csdnimg.cn/img_convert/71fa21a73d0b007b676ef2de55a24d7a.png" alt="TCP 三次握手流程图" loading="lazy"></p><p>​</p>',6),e=[_];function o(s,n){return t(),i("div",null,e)}const r=p(l,[["render",o],["__file","2-浏览器输入URL后的几个阶段.html.vue"]]);export{r as default};
